import { useState } from 'react';
import './App.css';

function App() {

  let [view, setView] = useState(false)

  return (
    <div className="App">
      <button onClick={ () => setView(!view)}>버튼</button>
      <button onClick={ () => setView(true)}>버튼 2</button>
      {
        view == true ? 'React 삼항연산자 연습' : null
      }
    </div>
  );
}

export default App;
